import React from "react";
import {
  CardContainer,
  CardImg,
  CardName,
  CardTypes,
  CardType,
} from "./PokemonCardElements";
import archen from "../../assets/images/archen.png";
import { pokemonTypes } from "../../data/PokemonData";

const PokemonCard = ({ name, types, img }) => {
  return (
    <CardContainer>
      <CardImg src={archen} />
      <CardName>Archen</CardName>
      <CardTypes>
        <CardType textColor="#FAF9F3;" bgcolor="#A38C21;">
          Rock
        </CardType>
        <CardType textColor="#4F4E4E;" bgcolor="#BDB9B8;">
          Flying
        </CardType>
      </CardTypes>
    </CardContainer>
  );
};

export default PokemonCard;
